import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import LoginComponent from './components/LoginComponent';
import HomeComponent from './components/HomeComponent';

function App() {
  return (
    <div className="App"  >
        <LoginComponent />
        <HomeComponent />
    </div>
  );
}

export default App;
